import React, { Component } from "react";
import { Card, ProgressBar } from "react-bootstrap";

export default class PlaylistItem extends Component {

  render() {
    return(
      <>
        <Card>
          <Card.Body>
            <Card.Title>Hello World</Card.Title>
            <Card.Text>
            Anant Shukla
            </Card.Text>
            <ProgressBar now={60} />
          </Card.Body>
        </Card>
      </>
    );
  }
}
